            des:'About how much i have practised it and how much i known about it.'
        },
        {
            name:'PYTHON',
            des:'About how much i have practised it and how much i known about it.'
        }
        
    ]
    return(
        <div className='skillsection'>
            <b style={{fontSize:'10vh'}}>Skills</b><hr/>
            <section>
                {skills.forEach((instance)=>
                    <div>
                        <h1>{instance.name}</h1>
                        <p>{instance.des}</p>
                    </div>
                )}
            </section>
        </div>
    )
}
